import React from 'react';


const ProfileStatusWithHooks = (props) => {
	return (
		<>
			{
				<div>
					<div><span>{props.profileStatus || '------'}</span></div>
					<div><input autoFocus={true}/></div>
				</div>
			}
			{false ? <button >Поставить Статус</button> : ''}
		</>
	);
}

export default ProfileStatusWithHooks;
